import React from "react";
import styled from "styled-components";
import Navbar from "../Navbar";

export default function Contact() {
  return (
    <div>
      <ContactContainer>
        <form>
          <input type="text" />
        </form>
      </ContactContainer>
    </div>
  );
}

const ContactContainer = styled.div`
  border: 2px solid greenyellow;
  position: absolute;
  width: 100%;

  top: 60%;
`;
